import './App.css';
import Search from './Components/Search';
import Navbar from './Components/Navbar';
import Cards from './Components/Card';
import React, { useState } from 'react';

function App() {

  const [fetchedData, setFetchedData] = useState(null);

  // Define a function to set the fetched data
  const setFetchedDataHandler = (data) => {
    setFetchedData(data);
  };
  return (
    <div style={{ padding: "10px" }}>
      <Navbar />
       <Search setFetchedData={setFetchedDataHandler} />

      {/* Render the Cards component and pass the fetched data as a prop */}
      {fetchedData && <Cards data={fetchedData} />}
      
    </div>
  );
}

export default App;
